import React, { Component } from 'react'
import { graphql } from 'react-apollo'
import { getSingleCarQuery } from '../queries/queries'


class CarDetails extends Component {
	render() {
		return (
		<div id="book-details">
			<p>ege</p>
		</div>
		);
	}
}

export default graphql(getSingleCarQuery, {
	options: (props) => {
		return {
			variables: {
				id: props.carId
			}
		}
	}
})(CarDetails)
